ontent="width=device-width, initial-scale=1, maximum-scale=1.0"/>\n  <title>\n  Portfolio\n  </title>\n  <meta name="description" content="a portfolio website">\n  <meta name="author" content="Dennis Morent">\n  <link href="https://fonts.googleapis.com/icon?family=Material+Icons" rel="stylesheet">\n</head>\n\n<body>\n\n  <header>\n\n\n\n<nav>\n<div class="nav-wrapper container">\n <a href="#" class="brand-logo">DM</a>\n\n\n<ul class="right">\n      <li class="navigation__item">\n      <a href="/drupal-8.6.3/">Home</a>\n    </li>\n      <li class="navigation__item">\n      <a href="/drupal-8.6.3/articles">Articles</a>\n    </li>\n      <li class="navigation__item">\n      <a href="/drupal-8.6.3/projects">Projects</a>\n    </li>\n      <li class="navigation__item">\n      <a href="/drupal-8.6.3/about">About</a>\n    </li>\n      <li class="navigation__item">\n      <a href="/drupal-8.6.3/contact">Contact</a>\n    </li>\n  \n       <li class="navigation__item account-nav">\n      <a href="/drupal-8.6.3/">Inaccessible</a>\n    </li>\n      <li class="navigation__item account-nav">\n      <a href="/drupal-8.6.3/user/login">Log in</a>\n    </li>\n    \n</ul>\n\n</nav>\n\n\n\n</div>\n  </header>\n\n\n\n\n\n<div class="flex-container">\n\n<main>\n\n  <section >\n    <h1 class="header center grey-text text-darken-3">Hi i''m Dennis :)</h1>\n    <div class="row center">\n      <h5 class="header light">I''m a full-stack developer from Bruges, Belgium\n        <br>\n        I can help you build your next product.\n        <br>\n        Have an idea you would like to discuss?\n      </h5>\n    </div>\n    <div class="row center">\n      <a href="contact" class="btn-large waves-effect waves-light red lighten-2">Contact me</a>\n    </div>\n    <br><br>\n  </section>\n\n  <section>\n    <div class="row">\n      <div class="col s12 m4">\n        <div class="icon-block">\n          <h2 class="center light-red-text"><i class="medium material-icons">devices</i></h2>\n          <h5 class="center">Responsive</h5>\n\n          <p class="light center-align">My products work on any device, big or small.</p>\n        </div>\n      </div>\n\n      <div class="col s12 m4">\n        <div class="icon-block">\n          <h2 class="center light-red-text"><i class="medium material-icons">lightbulb_outline</i></h2>\n          <h5 class="center">Intuitive</h5>\n\n          <p class="light center-align">An app should be easy to use, which is something I constantly aim for.</p>\n        </div>\n      </div>\n\n      <div class="col s12 m4">\n        <div class="icon-block">\n          <h2 class="center light-red-text"><i class="medium material-icons">flash_on</i></h2>\n          <h5 class="center">Fast</h5>\n          <p class="light center-align">Fast load times and lag free, my top priority.</p>\n        </div>\n      </div>\n    </div>\n    <br><br>\n    \n  </section>\n</main>\n\n\n\n<!-- THEME DEBUG -->\n<!-- THEME HOOK: ''region'' -->\n<!-- FILE NAME SUGGESTIONS:\n   * region--breadcrumb.html.twig\n   x region.html.twig\n-->\n<!-- BEGIN OUTPUT from ''core/modules/system/templates/region.html.twig'' -->\n  <div>\n    \n\n<!-- THEME DEBUG -->\n<!-- THEME HOOK: ''block'' -->\n<!-- FILE NAME SUGGESTIONS:\n   * block--sidebar-2.html.twig\n   * block--block-content--c2f4df06-4e26-41b8-a5b0-23b15bda0523.html.twig\n   * block--block-content.html.twig\n   * block--block-content.html.twig\n   x block.html.twig\n-->\n<!-- BEGIN OUTPUT from ''core/modules/block/templates/block.html.twig'' -->\n<div id="block-sidebar-2">\n  \n    \n      \n\n<!-- THEME DEBUG -->\n<!-- THEME HOOK: ''field'' -->\n<!-- FILE NAME SUGGESTIONS:\n   * field--block-content--body--basic.html.twig\n   * field--block-content--body.html.twig\n   * field--block-content--basic.html.twig\n   * field--body.html.twig\n   * field--text-with-summary.html.twig\n   x field.html.twig\n-->\n<!-- BEGIN OUTPUT from ''core/modules/system/templates/field.html.twig'' -->\n\n            <div><aside>\n<div class="car